import React from "react";

function App() {
  return (
    <div>
      <label for="">User</label>
      <input
        type="text"
        class="form-control"
        name=""
        id=""
        aria-describedby="helpId"
        placeholder=""
      ></input>
      <small id="helpId" class="form-text text-muted">
        Help text
      </small>
    </div>
  );
}

export default App;
